// Solution 1:
const freqAlphabets = (s) => {
    let result = [];
    for(let i=0;i<s.length;i++){
        if(s[i]==='#'){
            let num = parseInt(s.slice(i-2,i));
            result.splice(num-1,0,'a'+(num-1));
            i+=2;
        }else{
            result.push('a'+(parseInt(s[i])-1))
        }
    }
    return result.join("");
};

// Solution 2:
const freqAlphabets = s => [...s].reduce((p,c,i)=>(c!=='#'? p+='a'.repeat(parseInt(c)-1): p.slice(-parseInt(s.slice(i-2,i)))),"");
